@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {

}
<!-- As a link -->
<nav class="navbar navbar-dark bg-danger">
  <a class="navbar-brand" routerLink="/">Login-Page</a>
  <div class="form-inline"  >
    <button class="btn btn-dark mr-sm-2" routerLink="/login">Login</button>
    <button class="btn btn-warning my-2 my-sm-0" routerLink="/signup">Signup</button>
  </div>
  <div class="form-inline" >
    <div class="mr-sm-2 text-while" >hello, Admin</div>
    <button class="btn btn-warning my-2 my-sm-0" >Logout</button>
  </div>

</nav>
